import './profile.scss'
// import Bio from '../../components/bio/Bio';
import { useState, useEffect } from 'react';
//import {MdLocationPin} from 'react-icons/md';
import {MdAppShortcut} from 'react-icons/md';
//import Interest from '../interests/Interest';
import Posts from '../../components/posts/Posts';
import {MdOutlineFacebook} from 'react-icons/md';
//import {MdFiberManualRecord} from 'react-icons/md';
import Interest from '../../components/interest/Interest';
import {MdMail} from 'react-icons/md';
import {MdOutlineMore} from 'react-icons/md';
const Profile=()=> {

        //For getting the name of the user,
        const [name, setName]=useState('');
        //For calling the backend
        useEffect(()=>{
          //it does not support async functions, we have to call it differently
          (
            async()=>{
              //send a request to backend for the detail of the user
          const response = await fetch('http://127.0.0.1:8000/api/user',{
            //this is a get request(by default it is get)
            headers: {'Content-Type':'application/json'},
            //for getting cookies for verification,
            credentials:'include',
      
      
          } );
          //the contents of the user
            const content = await response.json();
      
            setName(content.name) //the name of the user
            }
          )();
        });
  return (
    <div className='profile'>
      <div className="images">
        <img src='data:image/jpeg;base64,' alt='' className='coverPic'></img>
          <img src='data:image/jpeg;base64,' alt='' className='profilePic'></img>
    </div>    
    <div className='bio'><p>A dot exploring this huge world and being amazed each day.
                    Interested in tech start-ups, stoicism, and movies. </p></div>
     <div className="profileContainer">
      <div className="uinfo">
        <div className="left">
          <a href='https://facebook.com'>
            <MdOutlineFacebook fontSize='large'/>
          </a>
          <a href='https://twitter.com'><MdAppShortcut/></a>
        </div>
        <div className="center">
          {/* to display username from databse */}
          <span>{name}</span>
          <div className="info">
            {/* <div className="items">
              <div className="item">
            <MdLocationPin/>
            <span>AIverse</span>
            </div>
            <div className="item">
            <MdFiberManualRecord/>
            <span>Straight</span>
            </div>
            </div> */}
            <div className="interest">
            <Interest />
            </div>
            <div className='button'>
            <button>Connect</button>
            </div>
          </div>
        </div>
        <div className="right">
        <MdMail/>
        <MdOutlineMore/>
        </div>
      </div>
     </div>
     {/* <div className="bio">
      <Bio/>
     </div> */}
     <div className="posts">
      <Posts/>
     </div>
    </div>
  )
}

export default Profile